Response: To find the height of the cylinder, we start with the formula for the volume of a cylinder, which is given by:
\[ V = \pi r^2 h \]
where \( V \) is the volume, \( r \) is the radius, and \( h \) is the height. We are given that the volume \( V = 45\pi \) cubic cm and the radius \( r = 3 \) cm. We need to find the height \( h \).

Substitute the given values into the volume formula:
\[ 45\pi = \pi (3)^2 h \]

Simplify the equation:
\[ 45\pi = \pi \cdot 9 \cdot h \]

Divide both sides of the equation by \( \pi \):
\[ 45 = 9h \]

Now, solve for \( h \) by dividing both sides by 9:
\[ h = \frac{45}{9} = 5 \]

Thus, the height of the cylinder is \( 5 \) cm.
