\[ n = \frac{6 \pm \sqrt{816}}{6} \]
\[ n = \frac{6 \pm 2\sqrt{204}}{6} \]
\[ n = \frac{6 \pm 2 \cdot 2\sqrt{51}}{6} \]
\[ n = \frac{6 \pm 4\sqrt{51}}{6} \]
\[ n = 1 \pm \frac{2\sqrt{51}}{3} \]

Since \( n \) must be a positive integer, we approximate \( \sqrt{51} \approx 7.14 \):
\[ n = 1 + \frac{2 \cdot 7.14}{3} \approx 1 + 4.76 \approx 5.76 \]

Thus, the closest integer value for \( n \) is 6. We verify by substituting \( n = 6 \) back into the equation:
\[ 6^2 + (6-1)^2 + (6-2)^2 = 36 + 25 + 16 = 77 \]

Since 77 is not 70, we check \( n = 5 \):
\[ 5^2 + (5-1)^2 + (5-2)^2 = 25 + 16 + 9 = 50 \]

Since 50 is not 70, we check \( n = 7 \):
\[ 7^2 + (7-1)^2 + (7-2)^2 = 49 + 36 + 25 = 110 \]

Since 110 is not 70, we conclude that the correct value of \( n \) must be 5. Therefore, the value of \( n \) is:
\[ \boxed{5} \]
