- Point \( A \) is at \( (-5, 4) \).
- Point \( B \) is at \( (-1, 3) \).

Next, we calculate the direction vector \( \overrightarrow{AB} \) using the coordinates of \( A \) and \( B \):
\[
\overrightarrow{AB} = B - A = (-1 - (-5), 3 - 4) = (4, -1)
\]

We are given that the direction vector must be of the form \( \begin{pmatrix} -7 \\ b \end{pmatrix} \). To match this form, we need to scale the direction vector \( (4, -1) \) appropriately.

Let's denote the scaling factor by \( k \). Then:
